import React from 'react';
import styled from "styled-components";

const Wrapper = styled.div`
  .searchBar {
    width: 588px;
    height: 48px;
    border: 1px solid;

    font-family: Montserrat;
  font-style: normal;
  font-weight: 500;
  font-size: 16px;
  line-height: 20px;

  display: flex;
  align-items: center;
  
  
  letter-spacing: -0.015em;
  }
`;

const SearchBar = (props) => {
  return <>
    <Wrapper>
      <div className="searchBar">
      <img src="assets/images/search.png" alt="search" className="search" />  검색
      </div>
      
    </Wrapper>
  </>;
};

export default SearchBar;
